function main(){$("a.page-scroll").click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var a=$(this.hash);if((a=a.length?a:$("[name="+this.hash.slice(1)+"]")).length)return $("html,body").animate({scrollTop:a.offset().top-40},900),!1}}),$(".navbar-nav li a").click(function(a){$(".navbar-toggle").is(":visible")&&$(".navbar-collapse").collapse("hide")})}main();
